# %% tags=['remove-cell']
#@title Define widget action
def explain_lime_button_func(obj):
    if lime_bb_toggle.value == 'tree':
        model_ = tree_clf
    else:
        model_ = logreg_clf

    instance_ =  np.array([
        lime_instance_toggle.children[0].value,
        lime_instance_toggle.children[1].value
        ]).astype(X.dtype)

    explained_class_ = lime_class_toggle.value.split(' ')[0].strip()
    explained_class_id_ = explained_class[explained_class_]

    petal_length_range_ = iris_petal_length_slider.value
    assert petal_length_range_[0] != petal_length_range_[1], (
        'The petal length split values must not be identical.')
    petal_width_range_ = iris_petal_width_slider.value
    assert petal_width_range_[0] != petal_width_range_[1], (
        'The petal width split values must not be identical.')

    data_samples_no = [i.value for i in sample_widget.children]
    x_range_ = [X[:, 0].min(),
                petal_length_range_[0],
                petal_length_range_[1],
                X[:, 0].max()]
    y_range_ = [X[:, 1].max(),
                petal_width_range_[1],
                petal_width_range_[0],
                X[:, 1].min()]
    data_ = []
    i = 0
    for y_ in range(len(y_range_)-1):
        for x_ in range(len(x_range_)-1):
            np.random.seed(42)
            d_ = np.random.uniform(
                low=(x_range_[x_]+0.1, y_range_[y_]-0.1),
                high=(x_range_[x_+1]-0.1, y_range_[y_+1]+0.1),
                size=(data_samples_no[i], 2))
            data_.append(d_)
            i += 1
    data_ = np.vstack(data_)

    explanation_ = explain_lime(petal_length_range_, petal_width_range_,
                                instance_, explained_class_id_, data_,
                                model_intercept_widget.value, model_)

    with lime_explain_out:
        lime_explain_out.clear_output(wait=True)
        plot_lime(data_,
                  explained_class_,
                  instance_,
                  petal_length_range_,
                  petal_width_range_,
                  explanation_,
                  model_)
        plt.show()

lime_explain_button.on_click(explain_lime_button_func)
lime_explain_button._click_handlers(lime_explain_button)  # pre-click the button

